Hitmarker* pHitmarker = new Hitmarker();

void Hitmarker::Initialize() {

	g_EventManager->AddListener(this, "player_hurt", false);
	g_EventManager->AddListener(this, "bullet_impact", false);
}

C_BaseEntity* Hitmarker::GetPlayer(int userid) {

	int pIndex = g_Engine->GetPlayerForUserID(userid);
	C_BaseEntity* pEntity = g_EntityList->GetClientEntity(pIndex);

	return pEntity;
}

void Hitmarker::Paint() {

	auto pLocal = g_EntityList->GetClientEntity(g_Engine->GetLocalPlayer());

	if (!g_Options.Misc.Hitmarker)
		return;

	if (!g_Engine->IsConnected() || !g_Engine->IsInGame() || !pLocal) {

		if (!pImpacts.empty())
			pImpacts.clear();

		if (!pHitmarkers.empty())
			pHitmarkers.clear();

		return;
	}

	long long pTime = g_Globals->curtime;

	std::vector<HitmarkerInfo>::iterator pIter;

	for (pIter = pHitmarkers.begin(); pIter != pHitmarkers.end(); ) {

		bool pExpired = pTime > pIter->pImpact.time + 500;

		if (pExpired)
			pIter->pAlpha -= 1;

		if (pExpired && pIter->pAlpha <= 0) {

			pIter = pHitmarkers.erase(pIter);
			continue;
		}

		Vector pos3D = Vector(pIter->pImpact.x, pIter->pImpact.y, pIter->pImpact.z), pos2D;

		if (!g_Render->WorldToScreen(pos3D, pos2D)) {

			++pIter;
			continue;
		}

		Color pColor = Color(g_Options.Colors.hitmarker_color[0] * 255.f, g_Options.Colors.hitmarker_color[1] * 255.f, g_Options.Colors.hitmarker_color[2] * 255.f, pIter->pAlpha);

		int pLineSize = 6;

		g_Render->Line(pos2D.x - pLineSize, pos2D.y - pLineSize, pos2D.x - (pLineSize / 4), pos2D.y - (pLineSize / 4), pColor);
		g_Render->Line(pos2D.x + pLineSize, pos2D.y - pLineSize, pos2D.x + (pLineSize / 4), pos2D.y - (pLineSize / 4), pColor);
		g_Render->Line(pos2D.x - pLineSize, pos2D.y + pLineSize, pos2D.x - (pLineSize / 4), pos2D.y + (pLineSize / 4), pColor);
		g_Render->Line(pos2D.x + pLineSize, pos2D.y + pLineSize, pos2D.x + (pLineSize / 4), pos2D.y + (pLineSize / 4), pColor);

		++pIter;
	}
}

void Hitmarker::FireGameEvent(IGameEvent* pEvent) {

	auto pLocal = g_EntityList->GetClientEntity(g_Engine->GetLocalPlayer());

	if (!g_Options.Misc.Hitmarker)
		return;

	if (!pEvent || !pLocal)
		return;

	if (!strcmp(pEvent->GetName(), "player_hurt"))
		PlayerHurt(pEvent);

	if (!strcmp(pEvent->GetName(), "bullet_impact"))
		BulletImpact(pEvent);
}

int Hitmarker::GetEventDebugID(void) { return 0x2A; }

void Hitmarker::PlayerHurt(IGameEvent* pEvent) {

	auto pLocal = g_EntityList->GetClientEntity(g_Engine->GetLocalPlayer());

	C_BaseEntity* pAttacker = GetPlayer(pEvent->GetInt("attacker"));
	C_BaseEntity* pVictim = GetPlayer(pEvent->GetInt("userid"));

	int pDamage = pEvent->GetInt("dmg_health");

	if (!pAttacker || !pVictim || pAttacker != pLocal)
		return;

	Vector enemyPosition = pVictim->GetVecOrigin();
	ImpactInfo pBestImpact;

	float pBestImpactDistance = -1;
	long long pTime = g_Globals->curtime;

	std::vector<ImpactInfo>::iterator pIter;

	for (pIter = pImpacts.begin(); pIter != pImpacts.end(); ) {

		if (pTime > pIter->time + 500) {

			pIter = pImpacts.erase(pIter);
			continue;
		}

		Vector position = Vector(pIter->x, pIter->y, pIter->z);
		float pDistance = position.DistTo(enemyPosition);

		if (pDistance < pBestImpactDistance || pBestImpactDistance == -1) {

			pBestImpactDistance = pDistance;
			pBestImpact = *pIter;
		}
		++pIter;
	}

	if (pBestImpactDistance == -1)
		return;

	HitmarkerInfo pInfo;
	pInfo.pImpact = pBestImpact;
	pInfo.pAlpha = 255;
	pInfo.pDamage = pDamage;
	pHitmarkers.push_back(pInfo);
}

void Hitmarker::BulletImpact(IGameEvent* pEvent) {

	auto pLocal = g_EntityList->GetClientEntity(g_Engine->GetLocalPlayer());

	C_BaseEntity* shooter = GetPlayer(pEvent->GetInt("userid"));

	if (!shooter || shooter != pLocal)
		return;

	ImpactInfo info;
	info.x = pEvent->GetFloat("x");
	info.y = pEvent->GetFloat("y");
	info.z = pEvent->GetFloat("z");

	info.time = g_Globals->curtime;
	pImpacts.push_back(info);
}


























































































































































































































































































































































































































































































































































































































